    [],nt"revision_timestamp": "2016-03-28T18:43:18.171210",nt"name": "akro-guided-angler-fish-landings",nt"isopen":
    false,nt"url": null,nt"notes": "Beginning in 2014, the the halibut Catch
    Sharing Plan (CSP) authorizes annual transfers of commercial halibut IFQ as guided
    angler fish (GAF) to charter halibut permit holders for harvest in the charter halibut
    fishery. GAF offers charter halibut permit holders in Area 2C or Area 3A an opportunity
    to lease a limited amount of IFQ from commercial quota share (QS) holders to allow
    charter clients to harvest halibut in addition to, or instead of, the halibut harvested
    under the daily bag limit for charter anglers. Charter anglers using GAF are subject
    to the harvest limits in place for unguided sport anglers in that area. nnInformation
    about GAF landings are submitted electronically through eFish, NMFS' integrated
    online system, and include details on when and where the GAF were caught, the number
    and length of fish, as well as permit, vessel, license, and logbook details. nn",nt"license_title":
